import React from 'react';
import { Route, BrowserRouter, Switch } from 'react-router-dom';
import { Login, Lobby } from './containers';

const Router = () => (
  <BrowserRouter>
    <Switch>
      <Route path="/" render={(props) => (
        <Login {...props} />
      )} />
      <Route path="/lobby" render={(props) => (
        <Lobby {...props} />
      )} />
    </Switch>
  </BrowserRouter>
);

export default Router;
